import React from "react";

import githubMark from "../../images/github-mark.svg";

import styles from "./Projects.module.css";

const Projects = () => {
  const projects = [
    {
      name: "MyGuitarShop Web Application",
      year: 2021,
      description:
        "In our two-person team, we developed a full stack web application using a combination of PHP, HTML, CSS, MySQL, and phpMyAdmin, which provided us with a robust platform for both front-end and back-end development. I was also responsible for integrating email functionality using the PHPMailer library, configuring it to send emails through Google's Gmail SMTP server.",
    },
  ];
  return (
    <div className={styles.projects}>
      <div className={styles.project}>
        <h1>MyGuitarShop Web Application</h1>
        <h2>2021</h2>
        <p>
          In our two-person team, we developed a full stack web application
          using a combination of PHP, HTML, CSS, MySQL, and phpMyAdmin, which
          provided us with a robust platform for both front-end and back-end
          development. I was also responsible for integrating email
          functionality using the PHPMailer library, configuring it to send
          emails through Google's Gmail SMTP server.
        </p>
        <div>
          <a
            href="https://github.com/BezDailey/MyGuitarShop"
            target="_blank"
            rel="noopener noreferrer"
          >
            <img className={styles.icon} src={githubMark} alt="Github Icon" />
          </a>
        </div>
      </div>
    </div>
  );
};

export default Projects;
